function PricingFree() {
  return (
    <div className="pricing__card">
        <div className="pricing__type">
          <div className="pricing__logo">
            <img src="../../../images/free.png" alt="free-logo" />
          </div>
          <div className="pricing__text"></div>
        </div>
        <div className="pricing__description"></div>
        <div className="pricing__price"></div>
        <div className="pricing__scope"></div>
    </div>
  )
}

export default PricingFree;
